import React, { Component } from "react";

class BOTON extends Component {
  state = {
    cont: 0,
  };

  suma = () => {
    this.setState({
      cont: this.state.cont + 1,
    });
  };

  resta = () => {
    this.setState({
      cont: this.state.cont - 1,
    });
  };

  render() {
    
  }
}

export default BOTON;
